import React, { useState } from 'react';
import axios from 'axios';

function App() {
  const [address, setAddress] = useState('');
  const [result, setResult] = useState(null);
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);

  const lookup = async () => {
    setError('');
    setResult(null);
    setLoading(true);
    try {
      const res = await axios.post('http://localhost:4000/lookup', { address });
      setResult(res.data);
    } catch (e) {
      setError(e.response?.data?.error || 'Lookup failed');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={{ maxWidth: 500, margin: '2rem auto', fontFamily: 'sans-serif' }}>
      <h2>School District Finder</h2>
      <input
        value={address}
        onChange={e => setAddress(e.target.value)}
        placeholder="Enter address"
        style={{ width: '100%', padding: 8, fontSize: 16 }}
      />
      <button onClick={lookup} style={{ marginTop: 10, padding: 8, fontSize: 16 }} disabled={loading}>
        {loading ? 'Looking up...' : 'Lookup'}
      </button>
      {error && <div style={{ color: 'red', marginTop: 10 }}>{error}</div>}
      {result && (
        <div style={{ marginTop: 20 }}>
          <b>District:</b> {result.district.NAME || JSON.stringify(result.district)}
          <br />
          <b>Location:</b> {result.location.lat}, {result.location.lon}
        </div>
      )}
    </div>
  );
}

export default App;
